import React from "react";

export default function ProductTile({ imageSource = "" }) {
  return (
    <>
      <div
        className="m-2"
        style={{ minWidth: "25vw", height: "32vw", border: "1px solid red" }}
      >
        <img
          style={{ objectFit: "cover" }}
          width="100%"
          height="100%"
          alt="somePhoto"
          src={imageSource}
        />
      </div>
    </>
  );
}
